import React, { Component } from "react";
import { Link } from 'react-router';
import {
    BrowserRouter as Router,
    Switch,
    Route,
    useParams, Redirect
} from "react-router-dom";
import { Navbar, Nav, NavDropdown, Form, FormControl, Button } from 'react-bootstrap'
import HomeDonor from './HomeDonor';
//import AboutUs from './AboutUs';
//import ContactUs from './ContactUs';
import '../index.css';
import logo from '../acons3.png';


class NavBarDonor extends Component {

  constructor(props) {
    super(props);
    this.state = {
      currentPage : this.props.data.currentPage,
      username : this.props.data.username
    };
  }

  clearConnections = (e) => {
    e.preventDefault();
    if (validateForm(this.state.errors)) {
        let donor = {
            pk_donor_id: this.state.donors[0].pk_donor_id, fk_user_id: this.props.data.userid,
            privacy_level: this.state.privacy_level
        };
        donorUpdate(donor).then(res => {
            console.log(res)
            console.log(this.state.userid)

        });
    } else {
        console.log('Invalid Input')
    }
}



    render() {
        return (
          <Navbar bg="light" expand="lg" position = "fixed">
          <Navbar.Brand href="/homedonor"><img src={logo} class="rounded float-left"  /></Navbar.Brand>
          <Navbar.Toggle aria-controls="basic-navbar-nav" />
          <Navbar.Collapse id="basic-navbar-nav">
            <Nav className="mr-auto">
            {this.state.currentPage === "HomePageDonor" ? <Nav.Link active href="#" >Home</Nav.Link> : <Nav.Link href="/homedonor" >Home</Nav.Link>}
            {this.state.currentPage === "DonorCharities" ? <Nav.Link active href="#" >Charities</Nav.Link> : <Nav.Link href="/donorcharities" >Charities</Nav.Link>}
            {this.state.currentPage === "MyDonations" ? <Nav.Link active href="#" >My Donations</Nav.Link> : <Nav.Link href="/donordonations" >My Donations</Nav.Link>}
            {this.state.currentPage === "DonorStatement" ? <Nav.Link active href="#" >Statement</Nav.Link> : <Nav.Link href="/donorstatement" >Statement</Nav.Link>}
            </Nav>
            <Nav className="mr-sm-2">
            {this.state.currentPage === "DonorEditDetails" ? <Nav.Link active href="#">Edit Details</Nav.Link> : <Nav.Link href="/editdetailsdonor">Edit Details</Nav.Link>}
            <Nav.Link href="/logout" className="btn btn-primary" onClick={clearConnections} >Logout {this.state.username}</Nav.Link>
            </Nav>
          </Navbar.Collapse>
        </Navbar> 
        
        /*<NavDropdown title="Donors" id="basic-nav-dropdown">
        <NavDropdown.Item href="#action/3.1">Action</NavDropdown.Item>
        <NavDropdown.Item href="#action/3.2">Another action</NavDropdown.Item>
        <NavDropdown.Item href="#action/3.3">Something</NavDropdown.Item>
        <NavDropdown.Divider />
        <NavDropdown.Item href="#action/3.4">Separated link</NavDropdown.Item>
      </NavDropdown>*/
        
          /*<nav class="navbar navbar-expand-lg navbar-light bg-light">
          <a class="navbar-brand" href="new.js">
            <img src={logo} class="rounded float-left" />
          </a>
          <button class="navbar-toggler" type="button" data-toggle="collapse" data-target="navbarNavAltMarkup"
            aria-controls="navbarNavAltMarkup" aria-expanded="false" aria-label="Toggle navigation">
            <span class="navbar-toggler-icon"></span>
          </button>
          <div class="collapse navbar-collapse" id="navbarNavAltMarkup" bg-light>
            <div class="navbar-nav">
  
              <a class="nav-item nav-link active" href="#">Home Page<span class="sr-only">(current)</span></a>
              <a class="nav-item nav-link" href="#">Donors</a>
              <a class="nav-item nav-link" href="#">Charities</a>
              <a class="nav-item nav-link" href="#">Register</a>
              <a class="nav-item nav-link" href="#">Logon</a>
            </div>
          </div>
        </nav>*/
        );
    }
}

export default NavBarDonor;
